import React from "react";
import "./form.style.css";
const Form = props => {
  return (
    <div className="container">
      <form onSubmit={props.loadweather,values()}>
        <div className="row">
          <div className="col-md-3">
            <input
              type="text"
              id = "01"
              className="form-control"
              name="city"
              autoComplete="off"
              placeholder="City"
            />
          </div>
          <div className="col-md-3">
            <input
              id = "02"
              type="text"
              className="form-control"
              name="city"
              autoComplete="off"
              placeholder="Country"
            />
          </div>
          <div className="col-md-3 mt-md-0 text-md-left">
            <button className="btn btn-warning">Get Weather</button>
          </div>
        </div>
      </form>
    </div>
  );
  function values(){
    const city = document.getElementById("01");
    const country = document.getElementById("02");
    console.log(city ,country);
  }
};
export default Form;
